import { useEffect, useState } from 'react';
import './App.css';
import Navbar from './components/Navbar';
import StationsList from './components/StationsList';
import Fecha from './components/Fecha'

function App() {

  const initialUrl = 'https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/'

  return (
    <div className="App">
      <Navbar title='Precios Gasolina' />
      <StationsList titulo='Gasolineras Arrecife' url={`${initialUrl}5237`}/>
      <StationsList titulo='Gasolineras San Bartolomé' url={`${initialUrl}5251`}/>
      <StationsList titulo='Gasolineras Haría' url='https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5243'/>
      <StationsList titulo='Gasolineras Teguise' url='https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5256'/>
      <StationsList titulo='Gasolineras Tías' url='https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5260'/>
      <StationsList titulo='Gasolineras Tinajo' url='https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5261'/>
      <StationsList titulo='Gasolineras Yaiza' url='https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5266'/>
      <Fecha url='https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5237'/>
    </div>

  );
}

export default App;
